import Link from 'next/link';

function landing() {
  return (
    <div className="row">
      <div className="col-12">
        <h1>This is landing page</h1>
      </div>
      <div className="col-12">
        <Link href="/">
          <button type="button" className="btn btn-primary">
            Logout
          </button>
        </Link>
      </div>
    </div>
  );
}

export default landing;
